    DETERMINISTIC
BEGIN
	declare minDias int;
    declare maxDias int;
    declare diasAleatorios int;
    declare fechaAleatoria date;
    
    set minDias = datediff(fechaInicio, '1900-01-01');
    set maxDias = datediff(fechaFin, '1900-01-01');
