CREATE DEFINER=`root`@`localhost` PROCEDURE `spMkUser`()
BEGIN
	DECLARE v_genero CHAR(3) DEFAULT ELT(fnNumeroAleatorioRangos(1,2), "M", "F");
    DECLARE v_pos_ubicacion INT DEFAULT NULL;
	DECLARE v_nombre_generado VARCHAR(50) DEFAULT fnGeneraNombre(v_genero);
	DECLARE v_primer_apellido VARCHAR(50) DEFAULT fnGeneraApellido();
	DECLARE v_segundo_apellido VARCHAR(50) DEFAULT fnGeneraApellido();
	DECLARE v_fecha_nacimiento DATE DEFAULT NULL;
	DECLARE v_fecha_valida BOOLEAN DEFAULT FALSE;
	DECLARE v_edad_persona INT DEFAULT FALSE;
	DECLARE v_fecha_edadminima DATETIME DEFAULT NULL;
	DECLARE v_fecha_inicio_youtube DATE DEFAULT "2023-08-08";
	DECLARE v_fecha_inferior_registro DATE DEFAULT NULL;
	DECLARE v_id_persona INT DEFAULT NULL;
	DECLARE v_fecha_registro DATETIME DEFAULT NULL;
	DECLARE v_id_ubicacion INT DEFAULT 0;
	DECLARE v_nombre_usuario VARCHAR(80) DEFAULT NULL;
	DECLARE v_email_usuario VARCHAR(256) DEFAULT NULL;
    
    SELECT CONCAT("Generando usuario random del genero: ", v_genero) as Mensaje;
    
	WHILE NOT v_fecha_valida  OR v_edad_persona <= 13 DO 
		SET v_fecha_nacimiento = fnGeneraFechaNacimiento("1970-01-01",NOW());
		SET v_edad_persona = fnCalculaEdad(v_fecha_nacimiento);
    
		IF v_edad_persona >= 13 THEN
			SET v_fecha_valida = TRUE;
		END IF;
    
   END WHILE;
   
   SET v_fecha_edadminima= DATE_ADD(v_fecha_nacimiento, INTERVAL 13 YEAR);
   
   IF v_fecha_edadminima < v_fecha_inicio_youtube THEN
		SET v_fecha_inferior_registro = v_fecha_inicio_youtube;
   ELSE
		SET v_fecha_inferior_registro = v_fecha_edadminima;
   END IF;
   
   INSERT INTO tbb_persona VALUES (DEFAULT, v_nombre_generado, v_primer_apellido, v_segundo_apellido, v_genero, v_fecha_nacimiento, DEFAULT, DEFAULT, NULL);
   SELECT "La persona correspondiente al Usuario ha sido creada." as Mensaje; 
   SET v_id_persona = last_insert_id();
   
   SET v_nombre_usuario=fnGeneraNombreUsuario(v_id_persona);
   SET v_email_usuario= fnGeneraEmail(v_nombre_generado,v_primer_apellido);
   INSERT INTO tbb_usuario VALUES (v_nombre_usuario, v_email_usuario, fnGeneraPwdRandom(8,15), DEFAULT, DEFAULT, DEFAULT, v_id_persona, fnNumeroAleatorioRangos(1,3), DEFAULT);
   
END ;;
DELIMITER ;
